import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const EditCategory = () => {
  const [formData, setFormData] = useState({});
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Mock API call
    fetch("http://172.22.9.59:3036/create_post", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => response.json())
      .then((data) => {
        console.log("Success:", data);
        navigate("/Category");
        setFormData({});
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };

  const editCategory = () => {
    navigate("/Category");
  };

  return (
    <div className="container-fluid">
      <div className="row">
        <div className="d-flex justify-content-between mt-3">
          <h4 className="fw-bold">Add Category</h4>
          <button className="btn btn-warning text-dark" onClick={editCategory}>
            Edit Category{" "}
          </button>
        </div>
        <div className="p-2">
          <form
            className="col-12 h-100 w-100 shadow p-5"
            onSubmit={handleSubmit}
          >
            <div className="row my-4">
              <div className="form-group col-lg">
                <label htmlFor="categoryname">Category Name:</label>
                <input
                  type="text"
                  className="form-control"
                  id="categoryname"
                  name="categoryname"
                  placeholder="Enter category Name"
                  value={formData.categoryname || ""}
                  onChange={handleChange}
                />
              </div>
              <div className="form-group col-lg-6">
                <label htmlFor="language">Language:</label>
                <select
                  id="language"
                  name="language"
                  className="form-control"
                  value={formData.language || ""}
                  onChange={handleChange}
                >
                  <option value="">...select...</option>
                  <option value="1">English</option>
                  <option value="2">Hindi</option>
                  <option value="3">Telugu</option>
                  <option value="4">Tamil</option>
                  <option value="5">Kannada</option>
                  <option value="6">Malayalam</option>
                </select>
              </div>
            </div>

            <div className="row my-4">
              <div className="form-group col-lg-6">
                <label htmlFor="home_view_type">Home View Type:</label>
                <select
                  id="home_view_type"
                  name="home_view_type"
                  className="form-control"
                  value={formData.home_view_type || ""}
                  onChange={handleChange}
                >
                  <option value="">...select...</option>
                  <option value="dark-block">dark-block</option>
                  <option value="light-block">light-block</option>
                  <option value="trending-block">trending-block</option>
                  <option value="number-slider">number-slider</option>
                  <option value="motion-slider">motion-slider</option>
                  <option value="photo-stories">photo-stories</option>
                  <option value="youtube-videos">youtube-videos</option>

                </select>
              </div>
              <div className="form-group col-lg-6">
                <label htmlFor="category_type">Category Type:</label>
                <select
                  type="text"
                  className="form-control"
                  id="category_type"
                  name="category_type"
                  placeholder="Enter category type"
                  value={formData.category_type || ""}
                  onChange={handleChange}
                >
                  {" "}
                  <option value="">...select...</option>
                  <option value="1">Post</option>
                  <option value="2">Video</option>
                  <option value="3">Vstories</option>
                </select>
              </div>
            </div>

            <div className="row my-4">
              <div className="form-group col-lg-6">
                <label htmlFor="status">Status:</label>
                <select
                  id="status"
                  name="status"
                  className="form-control"
                  value={formData.status || ""}
                  onChange={handleChange}
                >
                  <option value="">...select...</option>
                  <option value="1">Active</option>
                  <option value="0">Inactive</option>
                </select>
              </div>
            </div>

            <button type="submit" className="btn btn-primary">
              Submit
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default EditCategory;
